import ReactDOM from 'react-dom';
import { WeatherApi } from "../../src/api/api"


let WeatherMap = async () => {
    try {
        let Item = await WeatherApi();
        console.log(Item.data.records.location[0].weatherElement)
        let TestText = Item.data.records.location[0].weatherElement[0].time.map((item, i) =>
            <div key={i}>
                <h6>{item["startTime"]}</h6>
                <h6>{item["endTime"]}</h6>
                <h1>{item["parameter"]["parameterName"]}</h1>
            </div>
        )
        ReactDOM.render(
            <>{TestText}</>, document.getElementsByClassName("WeatherGroup")[0]
        );
    } catch (error) {
        console.log("異常", error);
    }
}

export function Weather() {
    setTimeout(() => {
        WeatherMap();
    }, 100);
    return <div className="WeatherGroup">天氣預測</div>
}
